$(function(){

        $(document).on('click','#hidden_close',function() {
            $('.menu__hiden').animate({
                left: '-385px'
            }, 200);
            $('.modal-overlay').removeClass('active-hiden-menu');
            $('.body').animate({ 
                left: '0px' 
            }, 200);
        });

        $('.btn-open').click(function() {
            $('.menu__hiden').animate({
                left: '0px'
            }, 200);
            $('.modal-overlay').addClass('active-hiden-menu');
            $('.body').animate({ 
                left: '185px' 
            }, 200);

        });
        
        $(document).on('click','.modal-overlay', function() {
             $('.body').animate({
                left: '-385px'
            }, 200);
            $('.modal-overlay').removeClass('active-hiden-menu');
        });

})


